import "./App.css";

const navbar = () => {
  return (
    <nav className="navbar">
      <h1>Medi-Scanner</h1>
      <div className="links">
        <a href="/">Home</a>
        <a href="/upload">Upload</a>
      </div>
    </nav>
  );
};

export default Navbar;
